import React from "react";
import Favourite from "./Favorite";
import "./index.css";
import Naat from "./Naat";
import Ndata from "./Ndata";
import Naveed from "./Naveed";

const favnat = "ipp";

const FavNaat = () => {
  if (favnat === "ip") {
    return <Favourite />;
  }
};

function ncard(val) {
  return (
    <Naat
      key={val.id}
      pic={val.pic}
      cat={val.cat}
      tit={val.tit}
      link={val.link}
      dlink={val.dlink}
    />
  );
}

function App() {
  return (
    <>
      <h4 className="heading_style">5 Good Naats </h4>
      <FavNaat />
    </>
  );
}

export default App;
